class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $k
     * @return Integer
     */
    function maximumScore($nums, $k) {
        $mod = 1e9 + 7;
        $n = count($nums);
        $primeScores = array_map([$this, 'primeScore'], $nums);
        $score = 1;

        for ($i = 0; $i < $k; $i++) {
            $maxScore = 0;
            for ($j = 0; $j < $n; $j++) {
                if ($primeScores[$j] > $maxScore) {
                    $maxScore = $primeScores[$j];
                    $maxIndex = $j;
                }
            }
            $score = ($score * $nums[$maxIndex]) % $mod;
            $primeScores[$maxIndex] = 0; // Remove the chosen element's prime score to avoid repetition
        }

        return $score;
    }

    private function primeScore($num) {
        $score = 0;
        for ($i = 2; $i * $i <= $num; $i++) {
            if ($num % $i == 0) {
                while ($num % $i == 0) {
                    $num /= $i;
                }
                $score++;
            }
        }
        if ($num > 1) $score++;
        return $score;
    }
}
